{{wiktionary|Cantonese|cantonese}} '''[[Cantonese]]''' is a language originating in Canton, Guangdong.
'''Cantonese''' may also refer to: * [[Yue Chinese]], Chinese languages that include Cantonese * [[Cantonese cuisine]], the cuisine of Guangdong province * [[Cantonese people]], the native people of Guangdong and Guangxi * [[Cantonese Braille]], a Cantonese language version of Braille in Hong Kong
